const Rout = () => {
	return (
		<Routes>
			<Route path='/' element={<HomePage />} />
			<Route path='/music' element={<MusicPage />} />
			<Route path='/admin' element={<AdminPage />} />
			<Route path='/contact' element={<HomePage />} />
		</Routes>
	)
}

export default Rout
